function ExpenseDate(props){
    const day = props.date.toLocaleString('de-DE', { day: '2-digit' } );
    const month = props.date.toLocaleString('de-DE', { month: 'long' } );
    const year = props.date.getFullYear();

    return (
        <div>
            <div>{day}</div>
            <div>{month}</div>
            <div>{year}</div>
        </div>
    );
}

export default ExpenseDate;
